  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0118785 contains oceanographic
  and surface meteorological data in netCDF formatted files, which follow the Climate
  and Forecast metadata convention (CF) and the Attribute Convention for Data Discovery
  (ACDD). SCCF collected the data from their in-situ moored station named tarponbay
  in the Coastal Waters of Florida, Gulf of Mexico and North Atlantic Ocean. SECOORA,
  which assembles data from SCCF and other sub-regional coastal and ocean observing
  systems of the southeast United States, submitted the data to NCEI as part of the
  Integrated Ocean Observing System Data Assembly Centers (IOOS DACs) Data Stewardship
  Program. Each month, NCEI adds to the Accession the data collected during the previous
  month.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
